import ArticleContent from "./article-content";
import ArticleHeader from "./article-header";

const Article = ({articleH}, {articleText}) => {
    return (
        <div className="article">
            <ArticleHeader articleH = {articleH}></ArticleHeader>
            <ArticleContent articleText = {articleText}></ArticleContent>
        </div>
    )
}
export default Article;
